import React, {Component} from 'react';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import CheckCircleOutlineIcon from '@material-ui/icons/CheckCircleOutline';
import AlarmOnIcon from '@material-ui/icons/AlarmOn';
import InsertChartIcon from '@material-ui/icons/InsertChart';
import { CardHeader } from '@material-ui/core';

const styles = them => ({
  root: {
    minWidth: 275,
    margin: '20px 50px 20px 50px',
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 40,
  },
  pos: {
    marginBottom: 12,
  },
});


class TempCard extends Component{
    constructor(props){
        super(props);
    }

    render(){    
        const { classes } = this.props;
        const date = new Date().getDate()+"/"+ new Date().getMonth() +"/"+ new Date().getFullYear();

        return (
            <Card className={classes.root}>
              <InsertChartIcon/>
              <CardHeader>
                {this.props.estado === 'In progress' && <InsertChartIcon/>}
                {this.props.estado === 'Ready' && <AlarmOnIcon/>}
                {this.props.estado === 'Completed' && <CheckCircleOutlineIcon/>}
              </CardHeader>
              <CardContent>
                <Typography className={classes.title} color="textPrimary" gutterBottom>
                    {this.props.titulo}
                </Typography>
                <br></br>
                <br></br>
                <Typography variant="h5" component="h5">
                    {this.props.estado}
                </Typography>
                <br></br>
                <Typography variant="h5" component="h3">
                    {date}
                </Typography>
                <Typography variant="h5" component="h5" color="textSecondary">
                    Santiago Carrillo
                </Typography>
              </CardContent>
            </Card>
          );
    }
}


export default withStyles(styles, { withTheme: true })(TempCard);
